import data from "../../data/index.json";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/navigation";
import { Navigation } from "swiper/modules";

export default function MyAchievements() {
  return (
    <section className="achievements--section" id="myAchievements">
      <div className="portfolio--container">
        <h2 className="achievements--section--heading">My Achievements</h2>
      </div>

      <div className="achievements--sliders">
        {/* Slider 1 */}
        <Swiper
          modules={[Navigation]}
          navigation
          spaceBetween={20}
          slidesPerView={1}
          breakpoints={{
            640: { slidesPerView: 1 },
            768: { slidesPerView: 2 },
            1024: { slidesPerView: 3 },
          }}
          className="achievements--slider"
        >
          {data?.achievements?.slice(0, Math.ceil(data.achievements.length / 2)).map((item, index) => (
            <SwiperSlide key={index}>
              <div className="achievements--card">
                <img
                  src={item.src}
                  alt={item.title}
                  width="54"
                  height="54"
                  style={{ objectFit: "contain" }}
                />
                <h3>{item.title}</h3>
                <p>{item.description}</p>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>

        {/* Slider 2 */}
        <Swiper
          modules={[Navigation]}
          navigation
          spaceBetween={20}
          slidesPerView={1}
          breakpoints={{
            640: { slidesPerView: 1 },
            768: { slidesPerView: 2 },
            1024: { slidesPerView: 3 },
          }}
          className="achievements--slider"
        >
          {data?.achievements?.slice(Math.ceil(data.achievements.length / 2)).map((item, index) => (
            <SwiperSlide key={index}>
              <div className="achievements--card">
                <img
                  src={item.src}
                  alt={item.title}
                  width="54"
                  height="54"
                  style={{ objectFit: "contain" }}
                />
                <h3>{item.title}</h3>
                <p>{item.description}</p>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>
    </section>
  );
}
